void goil_lexique::enterToken (const cTokenFor_goil_lexique & inToken) {
  cTokenFor_goil_lexique * ptr = NULL ;
  macroMyNew (ptr, cTokenFor_goil_lexique ()) ;
  ptr->mTokenCode = inToken.mTokenCode ;
  ptr->mFirstLocation = mTokenFirstLocation ;
  ptr->mLastLocation = mTokenLastLocation ;
  ptr->mTemplateStringBeforeToken = inToken.mTemplateStringBeforeToken ;
  ptr->mLexicalAttribute_a_string = inToken.mLexicalAttribute_a_string ;
  ptr->mLexicalAttribute_att_token = inToken.mLexicalAttribute_att_token ;
  ptr->mLexicalAttribute_floatNumber = inToken.mLexicalAttribute_floatNumber ;
  ptr->mLexicalAttribute_integerNumber = inToken.mLexicalAttribute_integerNumber ;
  ptr->mLexicalAttribute_number = inToken.mLexicalAttribute_number ;
  enterTokenFromPointer (ptr) ;
}

